function f(c){var d=new Map();c.split('').map(k=>{if(!d.has(k)){d.set(k,0)}d.set(k,d.get(k)+1)});var e=new Map();for(var k of d.keys()){var v=d.get(k);if(!e.has(v)){e.set(v,'')}e.set(v,e.get(v)+k)}var g="";Array.from(e).sort((a,b)=>a[0]-b[0]).forEach(a=>{var h="";for(i=0;i<a[0];i++){h+=a[1]}g+=h.split('').sort().join('')});console.log(g)}